(window.webpackJsonp=window.webpackJsonp||[]).push([[115],{TS2p:function(s){s.exports=[{id:1,type:"  vra7_deployment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"businessgroup_id",description:"<strong>(Optional)</strong> The id of the vRA business group to use for this deployment.\n",elementType:"li",listDepth:1},{name:"businessgroup_name",description:"<strong>(Optional)</strong> The name of the vRA business group to use for this deployment.\n",elementType:"li",listDepth:1},{name:"catalog_item_id",description:"<strong>(Optional)</strong> The id of the catalog item to deploy into vRA.\n",elementType:"li",listDepth:1},{name:"catalog_item_name",description:"<strong>(Optional)</strong> The name of the catalog item to deploy into vRA.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> Description of the deployment\n",elementType:"li",listDepth:1},{name:"reasons",description:"<strong>(Optional)</strong> Reasons for requesting the deployment\n",elementType:"li",listDepth:1},{name:"deployment_configuration",description:"<strong>(Optional)</strong> The configuration of the deployment from the catalog item\n",elementType:"li",listDepth:1},{name:"resource_configuration",description:"<strong>(Optional)</strong> The configuration of the individual components from the catalog item\n",elementType:"li",listDepth:1},{name:"nested-blocks",description:'<h2 id="nested-blocks">\n<a class="anchor" href="#nested-blocks" name="nested-blocks">\xbb</a>\n  Nested Blocks\n</h2>',elementType:"h2"},{name:"deployment_configuration-1",description:'<h3 id="deployment_configuration-1">\n<a class="anchor" href="#deployment_configuration-1" name="deployment_configuration-1">\xbb</a>\n  deployment_configuration\n</h3>',elementType:"h3"},{name:"",description:"<p>This block contains the deployment level properties including the custom properties. These are not a fixed set of properties but referred from the blueprint. There are generic properties like _leaseDays, _number_of_instances, etc but they are optional and from the example of the BasicSingleMachine blueprint, their is one custom property, called deployment_property which is required at request time.\nAll the properties that are required during request, must be specified in the config file.</p>",elementType:"p"},{name:"resource_configuration-1",description:'<h3 id="resource_configuration-1">\n<a class="anchor" href="#resource_configuration-1" name="resource_configuration-1">\xbb</a>\n  resource_configuration\n</h3>',elementType:"h3"},{name:"",description:'<p>This block contains the machine resource level properties including the custom properties. These are not a fixed set of properties but referred from the blueprint. The sample blueprint has one vSphere machine resource called vSphereVM1. Properties of this machine can be specified in the config in the format "vSphereVM1.property_name". The properties like cpu, memory, storage, etc are generic machine properties and their is a custom property as well, called machine_property in the sample blueprint which is required at request time. There can be any number of machines and same format has to be followed to specify properties of other machines as well.\nAll the properties that are required during request, must be specified in the config file.</p>',elementType:"p"},{name:"more-examples",description:'<h3 id="more-examples">\n<a class="anchor" href="#more-examples" name="more-examples">\xbb</a>\n  More examples\n</h3>',elementType:"h3"},{name:"",description:"<p><strong>Simple deployment of a CentOS Linux host with 2 CPU's:</strong></p>",elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"vra7_deployment"</span> <span class="s2">"machine"</span> <span class="p">{</span>\n  <span class="n">count</span>            <span class="o">=</span> <span class="mi">1</span>\n  <span class="n">catalog_item_name</span> <span class="o">=</span> <span class="s2">"CentOS 7.0 x64"</span>\n  <span class="n">resource_configuration</span> <span class="o">=</span> <span class="p">{</span>\n    <span class="no">Linux</span><span class="p">.</span><span class="nf">cpu</span> <span class="o">=</span> <span class="s2">"2"</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"",description:'<p><strong>Catalog "multi_machine_catalog" contains Linux, Windows and http (apache) designs:</strong></p>',elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"vra7_deployment"</span> <span class="s2">"resource_1"</span> <span class="p">{</span>\n  <span class="n">count</span>            <span class="o">=</span> <span class="mi">1</span>\n  <span class="n">catalog_item_name</span> <span class="o">=</span> <span class="s2">"multi_machine_catalog"</span>\n  <span class="n">resource_configuration</span> <span class="o">=</span> <span class="p">{</span>\n    <span class="no">Windows</span><span class="p">.</span><span class="nf">cpu</span> <span class="o">=</span> <span class="s2">"2"</span>                <span class="o">/</span><span class="sr">/Windows Machine CPU\n    Linux.cpu = "2"                  /</span><span class="o">/</span><span class="no">Linux</span> <span class="no">Machine</span> <span class="no">CPU</span>\n    <span class="n">http</span><span class="p">.</span><span class="nf">hostname</span> <span class="o">=</span> <span class="s2">"xyz.com"</span>        <span class="o">/</span><span class="sr">/HTTP (apache) hostname\n    http.network_mode = "bridge"     /</span><span class="o">/</span><span class="no">HTTP</span> <span class="p">(</span><span class="n">apache</span><span class="p">)</span> <span class="n">network</span> <span class="n">mode</span>\n  <span class="p">}</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"},{name:"",description:"<p><strong>Showing the use of <code>depends_on</code> between two deployments:</strong></p>",elementType:"p"},{name:"",description:"<p>Here the second resource, machine2 is dependent on the resource, machine1. So, machine2 will be provisioned after machine1.</p>",elementType:"p"},{name:"",description:'<div class="highlight"><pre class="highlight hcl"><code><span class="n">resource</span> <span class="s2">"vra7_deployment"</span> <span class="s2">"machine1"</span> <span class="p">{</span>\n  <span class="n">count</span>            <span class="o">=</span> <span class="mi">1</span>\n  <span class="n">catalog_item_name</span> <span class="o">=</span> <span class="s2">"CentOS 7.0 x64"</span>\n<span class="p">}</span>\n\n<span class="n">resource</span> <span class="s2">"vra7_deployment"</span> <span class="s2">"machine2"</span> <span class="p">{</span>\n  <span class="n">count</span>            <span class="o">=</span> <span class="mi">1</span>\n  <span class="n">catalog_item_name</span> <span class="o">=</span> <span class="s2">"CentOS 7.0 x64"</span>\n  <span class="n">depends_on</span> <span class="o">=</span> <span class="p">[</span><span class="s2">"vra7_deployment.machine1"</span><span class="p">]</span>\n<span class="p">}</span>\n</code></pre></div>',elementType:"div"}],docsUrl:"https://www.terraform.io/docs/providers/vra7/r/deployment.html",docType:""}]}}]);